        incorrect: <React.Fragment>[Ar] 4<i>s</i><sup>2</sup> 3<i>d</i><sup>7</sup></React.Fragment>,
        correct: <React.Fragment>[Ar] 3<i>d</i><sup>9</sup></React.Fragment>,
